function startGame(event) {
	event.target.remove()
	canv = document.getElementById("game");
	cw = canv.width = 800;
	ch = canv.height = 880;
	ctx = canv.getContext("2d");
	document.addEventListener("keydown", keyPress);
	setInterval(gameLoop, 1000/120);
	window.requestAnimFrame = (function(){
		return  window.requestAnimationFrame       || 
			window.webkitRequestAnimationFrame || 
			window.mozRequestAnimationFrame    || 
			window.oRequestAnimationFrame      || 
			window.msRequestAnimationFrame     || 
			function( callback ){
				window.setTimeout(callback, 1000 / 120);
			};
	})();
}

const playState = "play";
const waitState = "wait";
const gameOverState = "gameOver";

const backgroundColor = "#16002e";
const gridColor = "#0f001f";
const headColor = "#00c8ff";
const tailColor = "#00fff7";
const itemColor = "#f200ff";
const failColor = "#00c8ff";
const textColor = "#f200ff";

const musicVolume = .1;
const sfxVolume = .2;

const baseFont = "64px PixelFont"

const music = new Audio("assets/music.mp3");
const collectSound = new Audio("data:audio/wav;base64,");
const startSound = new Audio("data:audio/wav;base64,");
const failSound = new Audio("data:audio/wav;base64,");

const baseTail = 5;
const keyLeft = 37;
const keyRight = 39;
const keyUp = 38;
const keyDown = 40;
const gridStep = 20;
const tilesCount = 40;

let playerX = playerY = tilesCount / 2;
let appleX = appleY = tilesCount / 2 + tilesCount / 10;
let velocityX = velocityY = 0;
let trail = [];
let tail = baseTail;
let state = waitState;
let directionChanged = false;
let framesSkipped = 0;
let shadowBlur = 5;
let shadowIcrement = .1;


let score, pointSigns, baseMultiplier, baseMultiplierTime;


let explosion;
let particles = [];
let explosionFrame = 0;

function animate() {
	if (explosion == true && explosionFrame < 180) {
		requestAnimFrame(animate);
		drawExplosionFrame();
		explosionFrame++;
	} else {
		explosionFrame = 0;
		particles = [];
		explosion = false;
	}
}

function createParticle() {
	this.x = playerX * gridStep;
	this.y = playerY * gridStep;
	this.radius = 20; 
	this.vx = -5 + Math.random()*10;
	this.vy = -5 + Math.random()*10;
}

function drawScorePad() {
	ctx.fillStyle = textColor;
	ctx.font = baseFont;
	ctx.fillText(`${score} PTS`, 10, 860);
	if (baseMultiplierTime > 0) {
		ctx.fillStyle = tailColor;
		ctx.fillText(`${baseMultiplierTime}`, 400, 860);
	}
	ctx.fillText(`x ${baseMultiplier}`, 650, 860);
}

function gameLoop() {
	switch (state) {
		case gameOverState:
			drawBackground();
			gameOverScreen()
			drawScorePad();		
			break;
		case waitState:
			drawBackground();
			startScreen()
			break;
		case playState:
			fastCalculations();		
			slowCalculations();
			drawGame();
			break;
	}
}

function fastCalculations() {
	if (shadowBlur == 35) {
		shadowIcrement = -.5;
	} else if (shadowBlur == 5) {
		shadowIcrement = .5;
	}
	shadowBlur += shadowIcrement;
}

function slowCalculations() {
	if (framesSkipped == 10) {
		framesSkipped = 0;
		move();
	} else {
		framesSkipped++;
	}	
}

function drawGame() {
	drawBackground();
	drawItems();
	drawSnake();	
	drawPoints();
	drawScorePad();		
}

function drawSnake() {
	ctx.shadowColor = tailColor;
	ctx.shadowBlur = shadowBlur;
	ctx.fillStyle = tailColor;
	for (let i = 0; i < trail.length; i++) {
		if (i == trail.length - 1) {
			ctx.fillStyle = headColor;
		}
		ctx.fillRect(trail[i].x * gridStep, trail[i].y * gridStep, gridStep - 2, gridStep - 2);
	}
	ctx.shadowBlur = 0;
}

function startScreen() {
	ctx.fillStyle = textColor;
	ctx.font = baseFont;
	ctx.fillText("USE ARROW KEYS", (canv.width / 10 * 2.5), canv.height / 2);
}

function gameOverScreen() {
	if (! explosion) {
		ctx.fillStyle = textColor;
		ctx.font = baseFont;
		ctx.fillText("GAME OVER", (canv.width / 10 * 3), canv.height / 2);
	}
}

function availableFields() {
	let coordinates = [];
	for (let x = 0; x < tilesCount; x++) {
		for (let y = 0; y < tilesCount; y++) {
			coordinates.push({x:x,y:y});
		}
	}
	return coordinates.filter(function (item) {
		for (let i = 0; i < trail.length; i++) {
			if (trail[i].x == item.x && trail[i].y == item.y) {
				return false;
			}
		}
		return true;
	});
}

function drawBackground() {
	ctx.fillStyle = backgroundColor;
	ctx.fillRect(0, 0, canv.width, canv.height);
	for (let i = 0; i < tilesCount; i++) {
		for (let j = 0; j < tilesCount; j++) {
			ctx.fillStyle = gridColor;
			ctx.fillRect(i * gridStep, j * gridStep, gridStep - 2, gridStep - 2);
		}
	}
}

function drawItems() {
	ctx.shadowColor = itemColor;
	ctx.shadowBlur = shadowBlur;
	ctx.fillStyle = itemColor;
	ctx.fillRect(appleX * gridStep, appleY * gridStep, gridStep - 2, gridStep - 2);
	ctx.shadowBlur = 0;
}


function drawExplosionFrame() {
	ctx.globalCompositeOperation = "source-over";
    ctx.fillStyle = "rgba(0,0,0,0.15)";
    ctx.fillRect(0, 0, 800, 800);
	ctx.shadowBlur = 25;
	ctx.shadowColor = tailColor;
	for(let j = 0; j < particles.length; j++){
		let c = particles[j];
        ctx.fillStyle = tailColor;
		ctx.fillRect(c.x, c.y, 18, 18);
		c.x += c.vx;
		c.y += c.vy;
	}
	ctx.shadowBlur = 0;
}

function drawPoints() {
	ctx.shadowBlur = 10;
	ctx.shadowColor = textColor;
	for (let i = 0; i < pointSigns.length; i++) {
		if (pointSigns[i].timeLeft == 0) {
			pointSigns.shift();
		} else {
			ctx.fillStyle = textColor;
			ctx.font = `${pointSigns[i].size}px PixelFont`;
			ctx.fillText(pointSigns[i].points, pointSigns[i].x * gridStep, pointSigns[i].y * gridStep);
			pointSigns[i].timeLeft--;
			pointSigns[i].y -= .02;
			pointSigns[i].x += .01;
			pointSigns[i].size -= .5;
		}

	}
	ctx.shadowBlur = 0;
}

function move() {
	playerX += velocityX;
	playerY += velocityY;
	if (playerX < 0 || playerY < 0 || playerX > tilesCount - 1 || playerY > tilesCount - 1) {
		fail();
	}
	for (let i = 0; i < trail.length; i++) {
		if (trail[i].x == playerX && trail[i].y == playerY) {
			fail();
		}
	}
	trail.push({ x : playerX, y : playerY});
	while (trail.length > tail) {
		trail.shift();
	}
	if (appleX == playerX && appleY == playerY) {
		collectSound.currentTime = 0;
		collectSound.play();
		tail++;
		spawnItem();
		updateScore(10);
	}
	
	if (baseMultiplier > 1 && baseMultiplierTime > 0) {
		baseMultiplierTime--;
		if (baseMultiplierTime <= 0 && baseMultiplier > 1) {
			baseMultiplier--;
			if (baseMultiplier > 1) {
				baseMultiplierTime = 30;
			}
			
		}
	}
	

	directionChanged = false;
}

function updateScore(points) {
	baseMultiplierTime = 30;
	points = points * (baseMultiplier * getMultiplier());
	score += points;
	baseMultiplier++;
	pointSigns.push({x:playerX,y:playerY,points:points,timeLeft:60,size:46});
}

function getMultiplier() {
	multiplier = 1;
	for (let i = 0; i < trail.length; i++) {
		if (playerX - 1 == trail[i].x || playerX + 1 == trail[i].x) {
			if (playerY - 1 == trail[i].y || playerY + 1 == trail[i].y) {
				multiplier++;
			}
		}
	}
	return multiplier;
}

function spawnItem() {
	const available = availableFields();
	const rnd = Math.floor(Math.random() * available.length)
	appleX = available[rnd].x;
	appleY = available[rnd].y;
}

function fail() {
	if (state == playState) {
		for (var i = 0; i < tail * 2; i++) {
			particles.push(new createParticle());
		}
		music.pause();
		music.currentTime = 0;
		failSound.play();
		state = gameOverState;
		ctx.fillStyle = failColor;
		ctx.fillRect(0, 0, canv.width, canv.height);
		playerX = playerY = tilesCount / 2;
		explosion = true;
		animate();
	}
}

function newGame() {
	music.volume = musicVolume;
	startSound.volume = sfxVolume;
	failSound.volume = sfxVolume;
	collectSound.volume = sfxVolume;
	startSound.play();
	music.loop = true;
	music.play();
	score = 0;
	baseMultiplier = 1;
	baseMultiplierTime = 0;
	state = playState;
	pointSigns = [];
	trail = [];
	tail = baseTail;
	explosion = false;
}

function controls(keyCode) {
	if (state != playState && failSound.paused) {
		newGame();
	}
	if (directionChanged == false) {
		switch(keyCode) {
			case keyLeft:
				if (velocityX != 1) {
					velocityX = -1; velocityY = 0;
				}
				break;
			case keyUp:
				if (velocityY != 1) {
					velocityX = 0; velocityY = -1;
				}
				break;
			case keyRight:
				if (velocityX != -1) {
					velocityX = 1; velocityY = 0;
				}
				break;
			case keyDown:
				if (velocityY != -1) {
					velocityX = 0; velocityY = 1;
				}
				break;
		}
		directionChanged = true;
	}
}

function buttonTouch(keyCode) {
	controls(keyCode);
}

function keyPress(evt) {
	controls(evt.keyCode);
}